    {
        imgsrc:Digital,
        title:"Digital Marketing",
        link:"https://www.udemy.com/course/digital-marketing-guide/",
        btname:"Digital Course"
    }, 
    {
        imgsrc:Marketing,
        title:"Marketing",
        link:"https://www.udemy.com/course/business-fundamentals-marketing-strategy/",
        btname:"Marketing Course"
    }, 
    {
        imgsrc:Software,
        title:"Software Developer",
        link:"https://www.udemy.com/course/software-development-and-it-complete-guide-to-key-concepts/",
        btname:"Software Course"
    }
]

export default SData;
